import React from 'react';
import Button from './Button';

const buttonListItems = ['All', 'Songs', 'Gaming', 'Cricket', 'Soccer', 'News'];

const ButtonList = () => {
	return (
		<div className="flex">
			<Button name="All" />
			<Button name="Songs" />
			<Button name="Gaming" />
			<Button name="Cricket" />
			<Button name="Soccer" />
			<Button name="News" />
		</div>
	);
};

export default ButtonList;
